import React from 'react';
import { Routes as ReactRoutes, Route, Navigate } from 'react-router-dom';
import { Agency } from './view/Agency/Agency';

const Routes = () => {
  return (
    <ReactRoutes>
      <Route path="*" element={<Agency {...params} />} />
    </ReactRoutes>
  );
};

export default Routes;
